INSERT INTO `serie` (`ID_SERIE`, `ID_CATEGORIA`, `NAME_SERIE`, `IMAGEN`, `PRECIO`, `STOCK`, `URL`, `DESCRIPCION`) VALUES
(1, 1, 'Accel World', , '80.00', 145, 'https://www.youtube.com/embed/IGRAfhYEYKM', 'Es el otoño del 2046, Haruyuki es un estudiante de secundaria que es acosado por sus compañeros. Un día, un encuentro con Kuroyukihime, la chica más guapa de toda la escuela, le cambia la vida. A través de un programa que la chica le da a Haruyuki, este descubre la existencia del mundo virtual \"Accel World\". Ahora el último mono de la escuela será el \"Burst Linker\", un caballero que habrá de defender a una princesa.');
INSERT INTO `serie` (`ID_SERIE`, `ID_CATEGORIA`, `NAME_SERIE`, `IMAGEN`, `PRECIO`, `STOCK`, `URL`, `DESCRIPCION`) VALUES
(2, 1, 'Akame Ga Kill', , '70.00', 120, 'https://www.youtube.com/embed/_Dptqf3Hbyw', 'La historia nos lleva a través de las aventuras de Tatsumi, un joven boxeador que viajó a la capital imperial para unirse al ejército. Sin embargo, descubre que la ciudad está dañada por el ansia de poder de los funcionarios, que se aprovechan de la falta de experiencia del emperador para gobernar a su antojo. Después de tener cierto encuentro, Tatsumi se encuentra involucrado dentro de un grupo de asesinos en la sombra llamados \"Night Raid\", luchando contra la tiranía de la Ciudad Imperial.');
INSERT INTO `serie` (`ID_SERIE`, `ID_CATEGORIA`, `NAME_SERIE`, `IMAGEN`, `PRECIO`, `STOCK`, `URL`, `DESCRIPCION`) VALUES
(3, 1, 'Guilty Crow', , '90.00', 160, 'https://www.youtube.com/embed/DjUtmbZt8zc', 'La historia se desarrolla en Tokyo, durante el año 2039, 10 años después que un virus llamado ?Lost Christmas? atacase Japón, que ahora se encuentra controlado por la organización de varias naciones llamado GHQ. Ohma Shu tiene 17 años y tiene poderes especiales, la Habilidad del Rey, con el que suele tomar armas y herramientas de sus amigos. Aunque ha estado evitando meterse en problemas, eso cambiará cuando conozca a una chica llamada Yuzuriha Inori, miembro de la resistencia.');
INSERT INTO `serie` (`ID_SERIE`, `ID_CATEGORIA`, `NAME_SERIE`, `IMAGEN`, `PRECIO`, `STOCK`, `URL`, `DESCRIPCION`) VALUES
(4, 1, 'Sao Alicization', , '56.00', 120, 'https://www.youtube.com/embed/g38pXjUL6-s', '\"¿Dónde estoy...?\". Sin recordar cómo, Kirito se ha sumergido en un nuevo mundo virtual de fantasía. Con apenas unos pequeños retazos de recuerdos sobre lo que ocurrió antes de entrar al juego, comienza a vagar por él buscando alguna pista. Finalmente llega a un enorme y oscuro árbol, el Cedro Gigas, donde conoce a un joven. \"Me llamo Eugeo. Es un placer conocerte, Kirito\". Aunque es supuestamente un habitante de ese mundo virtual, un mero NPC, el joven parece mostrar el mismo abanico de emociones que cualquier ser humano. Kirito forja amistad con Eugeo y continúa buscando la forma de salir de este mundo virtual. Es entonces cuando recuerda algo que ocultaba en su interior. Recuerda haber corrido por las montañas con Eugeo cuando solo era un niño... Un recuerdo imposible que no debería tener, y en ese recuerdo ve también a una niña de cabellos rubios: Alice. Ese es un nombre que nunca deberá olvidar');
INSERT INTO `serie` (`ID_SERIE`, `ID_CATEGORIA`, `NAME_SERIE`, `IMAGEN`, `PRECIO`, `STOCK`, `URL`, `DESCRIPCION`) VALUES
(5, 1, 'One Punch Man', , '50.00', 145, 'https://www.youtube.com/embed/atxYe-nOa9w', 'La serie está protagonizada por un héroe que ha entrenado tanto que se ha quedado calvo, y tiene tanta fuerza que puede acabar con cualquier enemigo de un solo puñetazo. Sin embargo, al ser tan fuerte, se aburre y se frustra porque no le cuesta nada vencer sus batallas.');
INSERT INTO `serie` (`ID_SERIE`, `ID_CATEGORIA`, `NAME_SERIE`, `IMAGEN`, `PRECIO`, `STOCK`, `URL`, `DESCRIPCION`) VALUES
(6, 1, 'Fairy Gone', , '56.00', 60, 'https://www.youtube.com/embed/B8BAqO-p9LU', 'La historia nos trasladará a un mundo en el que las hadas poseen y residen en animales, proporcionándoles poderes especiales. Extrayendo quirúrgicamente los órganos a uno de estos animales e implantándoselos a un humano, los humanos pueden invocar parcialmente a las hadas y usarlas como armas. Estos humanos participarán en las guerras y serán conocidos como \"Soldados Hada\". Tras el fin de una larga guerra, estos Soldados Hada pierden su propósito y deben reintegrarse en la sociedad, aunque no todos tomarán el camino de la justicia. Nueve años después del fin de la guerra conocemos a Marlya, una nueva recluta en Dorothea, una organización dedicada a investigar y contrarrestar crímenes relacionados con hadas. Aun en tiempo de paz, la inestabilidad de la guerra todavía afecta al gobierno. Muchos criminales cargan con heridas de la guerra y los grupos terroristas buscan venganza por los actos de entonces. Una historia de soldados hada persiguiendo su propia justicia en un mundo caótico que');
INSERT INTO `serie` (`ID_SERIE`, `ID_CATEGORIA`, `NAME_SERIE`, `IMAGEN`, `PRECIO`, `STOCK`, `URL`, `DESCRIPCION`) VALUES
(7, 1, 'Radiant', , '45.00', 2, 'https://www.youtube.com/embed/TYOgahg7Esk', 'Seth es un joven que aspira a ser un gran hechicero y que vive con Alma, una experta hechicera, una remota isla. Los hechiceros son personas que han sobrevivido al contacto con los temibles Némesis, y los humanos normales los temen como a los monstruos. Que Seth sea un joven hechicero hace que desconfíen de él, y que siempre esté causando escándalos no ayuda. Cuando un Némesis ataca la isla, solo Seth podrá salvar a sus habitantes, los mismos que tanto parecen odiarlo. Por eso Seth tiene un objetivo claro: quiere acabar con todos los Némesis del mundo');
INSERT INTO `serie` (`ID_SERIE`, `ID_CATEGORIA`, `NAME_SERIE`, `IMAGEN`, `PRECIO`, `STOCK`, `URL`, `DESCRIPCION`) VALUES
(8, 1, 'Boku no hero academia', , '34.00', 78, 'https://www.youtube.com/embed/-77UEct0cZM', 'Las personas no nacen igual. El protagonista de esta historia es uno de esos casos raros que nacen sin superpoderes, pero esto no le impedirá perseguir su sueño: ser un gran héroe como el legendario All-Might. Para convertirse en el héroe que quiere ser, se apuntará a una de las academias de héroes más prestigiosas del país: Yueiko. Con la ayuda de su ídolo, All-Might, ¿podrá convertirse en un verdadero héroe?');
INSERT INTO `serie` (`ID_SERIE`, `ID_CATEGORIA`, `NAME_SERIE`, `IMAGEN`, `PRECIO`, `STOCK`, `URL`, `DESCRIPCION`) VALUES
(9, 2, 'Dororo', , '45.00', 120, 'https://www.youtube.com/embed/5DCGQ57ykME', 'Daigo Kagemitsu es un temible samurái que entregó su futuro hijo a demonios, a cambio de ver cumplido su sueño de conquistar el país. Al cabo del tiempo, nació un niño deforme, al que faltaban cuarenta y ocho partes de su cuerpo. Su ambicioso padre lo arrojó al río, pero el pequeño logró sobrevivir y, con el tiempo, convertirse en un diestro espadachín llamado Hyakkimaru, «pequeño monstruo». Años después, con la ayuda del joven y avispado Dororo, quien afirma ser el mejor ladrón de Japón, Hyakkimaru emprenderá un viaje a lo largo del cual se enfrentará a los demonios para recuperar las partes de su cuerpo.');
INSERT INTO `serie` (`ID_SERIE`, `ID_CATEGORIA`, `NAME_SERIE`, `IMAGEN`, `PRECIO`, `STOCK`, `URL`, `DESCRIPCION`) VALUES
(10, 2, 'Fairy Tail', , '45.00', 345, 'https://www.youtube.com/embed/d4DzoURbzWM', 'Fairy Tail cuenta la historia de un joven mago llamado Natsu en la búsqueda de su maestro y padre adoptivo Igneel que resulta ser un dragón. Por ello se unió a Fairy Tail, un gremio de magos que es famoso por los destrozos y daños que provocan en diversas ciudades (lo cual no debería ser así). El mundo de Fairy Tail gira alrededor de los magos (los cuales poco tienen que ver con la idea general del mago común) que realizan encargos a cambio de dinero, similar a un cazarecompensas. Natsu conoce a Lucy, una guapa muchacha cuyo sueño era ingresar a un gremio de magos, específicamente, a Fairy Tail, lo cual consigue gracias a la ayuda de Natsu. De ahí en adelante, la historia sigue los movimientos de esta pareja de magos los cuales se ven envueltos en un sin número de aventuras antes de conseguir la meta final de encontrar a Igneel.');
INSERT INTO `serie` (`ID_SERIE`, `ID_CATEGORIA`, `NAME_SERIE`, `IMAGEN`, `PRECIO`, `STOCK`, `URL`, `DESCRIPCION`) VALUES
(11, 2, 'Grimms note', , '25.00', 560, 'https://www.youtube.com/embed/IawA0TBk7Ng', 'En un mundo que parece sacado de un cuento de hadas, cada persona recibe un libro el día que nace. Estos libros los escribe un misterioso cuentacuentos y determinan todos los detalles de la vida de su dueño, atrapándolo en un destino del cual no puede escapar. Pero un día nace un héroe libre para decidir su destino, puesto que su libro solo contiene páginas en blanco. Esto sin embargo lo convierte en el único del mundo que no sabe qué hacer, así que vaga buscando un propósito en la vida. Para ello viaja por el mundo recorriendo tierras varias y conociendo a personajes de algunos de los cuentos clásicos más famosos. Junto a ellos luchará para conocer su destino y forjar su propia historia.');
INSERT INTO `serie` (`ID_SERIE`, `ID_CATEGORIA`, `NAME_SERIE`, `IMAGEN`, `PRECIO`, `STOCK`, `URL`, `DESCRIPCION`) VALUES
(12, 2, 'Jojo?s Golden Wind', , '17.00', 78, 'https://www.youtube.com/embed/ZdcdMzJPJS0', 'El manga original continúa la historia de las entregas anteriores del manga Jojo Bizarre Adventure, cuando Jotaro le pide a Koichi que viajen a Nápoles para investigar a una persona conocida como Haruno Shiobana, cuyo verdadero nombre se revela más tarde como Giorno Giovanna. La historia luego sigue a Giorno en su objetivo de ascender a la cima del grupo Passione y convertirlo en una banda de ladrones honorables.');
INSERT INTO `serie` (`ID_SERIE`, `ID_CATEGORIA`, `NAME_SERIE`, `IMAGEN`, `PRECIO`, `STOCK`, `URL`, `DESCRIPCION`) VALUES
(13, 2, 'Re Zero', , '38.00', 120, 'https://www.youtube.com/embed/iu_0kOfMGD0', 'En la historia, Subaru Natsuki es un estudiante corriente de instituto que se pierde en un mundo alternativo, donde una preciosa chica de pelo plateado lo rescata. Para devolverle el favor decide quedarse con ella, pero el destino con el que carga la muchacha es mucho más pesado de lo que Subaru puede imaginar. Los enemigos atacan sin descanso, uno tras otro, hasta que finalmente mueren tanto él como la chica. Es entonces cuando Subaru descubre que tiene el poder de dar marcha atrás en el tiempo y volver al inicio de la historia, al punto en el que llegó al mundo desconocido. El problema es que él es el único que recuerda lo ocurrido.');
INSERT INTO `serie` (`ID_SERIE`, `ID_CATEGORIA`, `NAME_SERIE`, `IMAGEN`, `PRECIO`, `STOCK`, `URL`, `DESCRIPCION`) VALUES
(14, 3, 'Initial D', , '30.00', 45, 'https://www.youtube.com/embed/CJAF-1TAM7g', 'Takumi Fujiwara trabaja como bombero en una estación de servicio por el dia, y entregando tofu para la tienda de su padre por las noches. Poco sabe de sus excelentes habilidades al volante, y con el Toyota Sprinter AE86 Trueno es el mejor conductor amateur en la carretera del monte Akina. A causa de esto, grupos de carrera de toda la prefectura de Gunma buscan desafiar a a Takumi para ver si realmente tiene lo necesario para ser una estrella de la calle.');
INSERT INTO `serie` (`ID_SERIE`, `ID_CATEGORIA`, `NAME_SERIE`, `IMAGEN`, `PRECIO`, `STOCK`, `URL`, `DESCRIPCION`) VALUES
(15, 3, 'Capeta', , '25.00', 120, 'https://www.youtube.com/embed/CeWjbEjoh_g', 'Kappeita Taira ( ? ??Taira Kappeita ) , también conocida como \"Capeta\" ( ? ? ?Kapeta ) , es un niño de diez años cuyo padre, padre soltero, Shigei Taira ( ??Taira Shigei ) , trabaja para una empresa de pavimentación. Mientras completaba un trabajo de pavimentación en una pista de karts, su padre ve a un niño corriendo en la pista y se sorprende de la velocidad y la emoción del deporte. Al darse cuenta de que su hijo pequeño está interesado en los autos de carrera (especialmente en Fórmula Uno), Shigei le pregunta al administrador del circuito si puede sacar algunas piezas viejas y desgastadas de la pila de basura del circuito. Al llevarlos de vuelta a su lugar de trabajo, se las arregla para construir un kart ruinoso pero manejable. El jefe de Shigei, el Sr. Ikari, (inicialmente a regañadientes) suministra un motor generador de 4 tiempos para impulsar el kart.');
INSERT INTO `serie` (`ID_SERIE`, `ID_CATEGORIA`, `NAME_SERIE`, `IMAGEN`, `PRECIO`, `STOCK`, `URL`, `DESCRIPCION`) VALUES
(16, 3, 'Meteoro', , '45.00', 120, 'https://www.youtube.com/embed/zzqxQymfQqc', 'Speed Racer (Emile Hirsch) nació en una familia que está en el negocio de los autos de carreras y es una de las grandes estrellas. Sentado tras el volante de su Mach 5, Speed frecuentemente gana las competencias. Cuando no acepta una oferta del presidente de Industrias Royalton, descubre un terrible secreto: magnates poderosos están arreglando las carreras. Con la esperanza de vencer a Royalton en su propio juego, Speed participa en la misma carrera que cobró la vida de su querido hermano.');

